  <Layout>
    <div>
      <h1 className="title my-0">Welcome to Color View!</h1>
      <p className="desc mb-5 mt-3">What do you want to do?</p>

      <div className="btn--container">
        <Link href="/colorname">
          <button className="btn btn-primary">Get some color name</button>
        </Link>
      </div>
    </div>
  </Layout>
